(function($){
	//check the browsers type
	var ua = navigator.userAgent.toLowerCase();

	var isChrome = ua.match(/chrome\/([\d.]+)/);
	var isSafari = ua.match(/version\/([\d.]+)/);
	var isFirefox = ua.match(/firefox\/([\d.]+)/);
	var isIE = ua.match(/msie ([\d.]+)/);

	smr.isChrome = isChrome;
	smr.isSafari = isSafari;
	smr.isFirefox = isFirefox;
	smr.isIE = isIE;

	if(isIE){
		if(isIE[1] == '9.0' && document.documentMode == 9){
			//do nothing
		}else{
			//in IE does not support indexOf
			if(!Array.indexOf){
			    Array.prototype.indexOf = function(obj){
			        for(var i=0; i<this.length; i++){
			            if(this[i]==obj){
			                return i;
			            }
			        }
			        return -1;
			    }
			}

			//in IE does not support localStorage
			if(typeof localStorage == 'undefined'){
				//create localStorage
				var localStorageClass = function(){
					this.options = {
				        expires : 60*24*3600,
				        domain : "bin_gao@live.cn"
				    }
				}
				localStorageClass.prototype = {
					//init ,add expire time
					init:function(){
				        var date = new Date();
				        date.setTime(date.getTime() + 60*24*3600);
				        this.setItem('expires',date.toGMTString());
				    },
				    //check the key
				    findItem:function(key){
				        var bool = document.cookie.indexOf(key);
				        if( bool < 0 ){
				            return true;
				        }else{
				            return false;
				        }
				    },
				    //get item value, if not return null
				    getItem:function(key){
				        var i = this.findItem(key);
				        if(!i){
				            var array = document.cookie.split(';')
				            for(var j=0;j<array.length;j++){
				                var arraySplit = array[j];
				                if(arraySplit.indexOf(key) > -1){
				                	var getValue = array[j].split('=');
				                    getValue[0] = getValue[0].replace(/^\s\s*/, '').replace(/\s\s*$/, '')
				                    if(getValue[0]==key){
				                    	return getValue[1];
				                    }else{
				                    	return 'null';
				                    }
				                }
				            }
				        }
				    },
				    //set item
				    setItem:function(key,value){
				    	var i = this.findItem(key)
				    	document.cookie=key+'='+value;
				    },
				    //removeItem item
				    removeItem:function(key){
				    	var i = this.findItem(key)
				    	document.cookie=key+'='+"";
				    },
				    //clear cookie
				    clear:function(){
				    	for(var cl =0 ;cl<arguments.length;cl++){
				            var date = smr.serverDate;
				            date.setTime(date.getTime() - 100);
				            document.cookie =arguments[cl] +"=a; expires=" + date.toGMTString();
				        }
				    }
				}
			    localStorage = new localStorageClass();
			    localStorage.init();
			}
		}
	}
})(jQuery);

//IE7 does not support the JSON
if((smr.isIE && smr.isIE[1] == '7.0') || (smr.isIE && document.documentMode == 7)){
	var JSON;
	if (!JSON) {
	    JSON = {};
	}
	(function () {
	    'use strict';

	    function f(n) {
	        // Format integers to have at least two digits.
	        return n < 10 ? '0' + n : n;
	    }

	    if (typeof Date.prototype.toJSON !== 'function') {

	        Date.prototype.toJSON = function (key) {

	            return isFinite(this.valueOf())
	                ? this.getUTCFullYear()     + '-' +
	                    f(this.getUTCMonth() + 1) + '-' +
	                    f(this.getUTCDate())      + 'T' +
	                    f(this.getUTCHours())     + ':' +
	                    f(this.getUTCMinutes())   + ':' +
	                    f(this.getUTCSeconds())   + 'Z'
	                : null;
	        };

	        String.prototype.toJSON      =
	            Number.prototype.toJSON  =
	            Boolean.prototype.toJSON = function (key) {
	                return this.valueOf();
	            };
	    }

	    var cx = /[\u0000\u00ad\u0600-\u0604\u070f\u17b4\u17b5\u200c-\u200f\u2028-\u202f\u2060-\u206f\ufeff\ufff0-\uffff]/g,
	        escapable = /[\\\"\x00-\x1f\x7f-\x9f\u00ad\u0600-\u0604\u070f\u17b4\u17b5\u200c-\u200f\u2028-\u202f\u2060-\u206f\ufeff\ufff0-\uffff]/g,
	        gap,
	        indent,
	        meta = {    // table of character substitutions
	            '\b': '\\b',
	            '\t': '\\t',
	            '\n': '\\n',
	            '\f': '\\f',
	            '\r': '\\r',
	            '"' : '\\"',
	            '\\': '\\\\'
	        },
	        rep;


	    function quote(string) {
	        escapable.lastIndex = 0;
	        return escapable.test(string) ? '"' + string.replace(escapable, function (a) {
	            var c = meta[a];
	            return typeof c === 'string'
	                ? c
	                : '\\u' + ('0000' + a.charCodeAt(0).toString(16)).slice(-4);
	        }) + '"' : '"' + string + '"';
	    }


	    function str(key, holder) {

	        var i,          // The loop counter.
	            k,          // The member key.
	            v,          // The member value.
	            length,
	            mind = gap,
	            partial,
	            value = holder[key];

	        if (value && typeof value === 'object' &&
	                typeof value.toJSON === 'function') {
	            value = value.toJSON(key);
	        }

	        if (typeof rep === 'function') {
	            value = rep.call(holder, key, value);
	        }
	        switch (typeof value) {
	        case 'string':
	            return quote(value);
	        case 'number':
	            return isFinite(value) ? String(value) : 'null';
	        case 'boolean':
	        case 'null':
	            return String(value);
	        case 'object':

	            if (!value) {
	                return 'null';
	            }
	            gap += indent;
	            partial = [];

	            if (Object.prototype.toString.apply(value) === '[object Array]') {
	                length = value.length;
	                for (i = 0; i < length; i += 1) {
	                    partial[i] = str(i, value) || 'null';
	                }
	                v = partial.length === 0
	                    ? '[]'
	                    : gap
	                    ? '[\n' + gap + partial.join(',\n' + gap) + '\n' + mind + ']'
	                    : '[' + partial.join(',') + ']';
	                gap = mind;
	                return v;
	            }

	            if (rep && typeof rep === 'object') {
	                length = rep.length;
	                for (i = 0; i < length; i += 1) {
	                    if (typeof rep[i] === 'string') {
	                        k = rep[i];
	                        v = str(k, value);
	                        if (v) {
	                            partial.push(quote(k) + (gap ? ': ' : ':') + v);
	                        }
	                    }
	                }
	            } else {
	                for (k in value) {
	                    if (Object.prototype.hasOwnProperty.call(value, k)) {
	                        v = str(k, value);
	                        if (v) {
	                            partial.push(quote(k) + (gap ? ': ' : ':') + v);
	                        }
	                    }
	                }
	            }

	            v = partial.length === 0
	                ? '{}'
	                : gap
	                ? '{\n' + gap + partial.join(',\n' + gap) + '\n' + mind + '}'
	                : '{' + partial.join(',') + '}';
	            gap = mind;
	            return v;
	        }
	    }

	// If the JSON object does not yet have a stringify method, give it one.
	    if (typeof JSON.stringify !== 'function') {
	        JSON.stringify = function (value, replacer, space) {

	            var i;
	            gap = '';
	            indent = '';

	            if (typeof space === 'number') {
	                for (i = 0; i < space; i += 1) {
	                    indent += ' ';
	                }
	            } else if (typeof space === 'string') {
	                indent = space;
	            }
	            rep = replacer;
	            if (replacer && typeof replacer !== 'function' &&
	                    (typeof replacer !== 'object' ||
	                    typeof replacer.length !== 'number')) {
	                throw new Error('JSON.stringify');
	            }
	            return str('', {'': value});
	        };
	    }

	    if (typeof JSON.parse !== 'function') {
	        JSON.parse = function (text, reviver) {
	            var j;

	            function walk(holder, key) {
	                var k, v, value = holder[key];
	                if (value && typeof value === 'object') {
	                    for (k in value) {
	                        if (Object.prototype.hasOwnProperty.call(value, k)) {
	                            v = walk(value, k);
	                            if (v !== undefined) {
	                                value[k] = v;
	                            } else {
	                                delete value[k];
	                            }
	                        }
	                    }
	                }
	                return reviver.call(holder, key, value);
	            }

	            text = String(text);
	            cx.lastIndex = 0;
	            if (cx.test(text)) {
	                text = text.replace(cx, function (a) {
	                    return '\\u' +
	                        ('0000' + a.charCodeAt(0).toString(16)).slice(-4);
	                });
	            }

	            if (/^[\],:{}\s]*$/
	                    .test(text.replace(/\\(?:["\\\/bfnrt]|u[0-9a-fA-F]{4})/g, '@')
	                        .replace(/"[^"\\\n\r]*"|true|false|null|-?\d+(?:\.\d*)?(?:[eE][+\-]?\d+)?/g, ']')
	                        .replace(/(?:^|:|,)(?:\s*\[)+/g, ''))) {
	                j = eval('(' + text + ')');
	                return typeof reviver === 'function'
	                    ? walk({'': j}, '')
	                    : j;
	            }
	            throw new SyntaxError('JSON.parse');
	        };
	    }
	}());
}

