			if(dataType == "links" || dataType == "failure" || dataType == "sharing" || dataType == "sharingFtaf" || dataType == "linksConversion"){
				paramObject.program = true;
			}
			if(breakDownType=="client" || breakDownType=="browser" || breakDownType=="device"){
			   paramObject.program = true;
			}
